import React from 'react';
import './App.css';

export class Header extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            aTags: ['Home', 'Bio', 'Gallery'],
            date: new Date()
        }
    }

    render() {
        return <div>
            <h1>Hello World</h1>
        </div>
    }
}
